Do not go gentle into that good night,
Old age should burn and rave at close of day;
Rage, rage against the dying of the light.

@ARobichu @DianorVallon @GregoirePerra Un paranoïde roule en voiture sur l'autoroute.
La radio annonce "attention, une voiture fantôme est engagée sur l'autoroute".
Le paranoïde, pseudo-sceptique, de rage, éteint la radio "Encore une fake news! Il devrait revoir leurs biais : ce n'est pas 1 voiture, c'est 50!".

@Alexis_Cossette Trump est arrivé comme un A380 dans la tour démocrate,quatre années plus tard elle s’effondre sur elle même, en flamme, en cris et en rage, par leurs actes.
Ils n’ont pas de porte de sortie, seront nus en pleine lumière, il ne restera qu’a les cueillir comme des champignons.
1/2
